      var height = (window.innerHeight > 0 ? window.innerHeight : window.screen.height) - 4;
      height = height - topOffset;
      if (height < 1) height = 1;
      if (height > topOffset) {
        $('#page-wrapper').css('min-height', height + 'px');
      }
    } else {
      $('div.navbar-collapse').removeClass('collapse');
    }

    var url = window.location.href;
    var element = $('ul.nav a').filter(function filterCb() {
      return this.href === url;
    }).addClass('active').parent('li');
    var ifContinue = true;
    while (ifContinue) {
      if (element.is('li')) {
        element = element.parent('ul').addClass('in').parent('li').addClass('active');
      } else {
        ifContinue = false;
      }
    }
  })();

