".tab-content {
  margin-top: 10px;
}
"

"@media (min-width: 1280px) {
  .modal-lg {
    width: 1200px;
  }
}

@media (min-width: 1440px) {
  .modal-lg {
    width: 1350px;
  }
}"

".sidebar {
  #side-menu {
    visibility: hidden;
  }
  
  ul li {
    border-bottom: 1px solid darken(@gray-lightest, 6.5%);
    a {
      &.active {
        background-color: @gray-lighter;
      }
    }
  }

  .sidebar-nav.navbar-collapse {
    padding-left: 0;
    padding-right: 0;
  }

  .sidebar-search {
    padding: 15px;
  }

  .arrow {
    float: right;

    &.iconfont:before {
      content: "\e608";
    }
  }

  .active > a > .iconfont.arrow:before {
    content: "\e607";
  }

  .nav-second-level li, .nav-third-level li {
    border-bottom: none !important;
  }

  .nav-second-level li a {
    padding-left: 37px;
  }

  .nav-third-level li a {
    padding-left: 52px;
  }
}

@media(min-width:768px) {   //PC端
  .sidebar {
    z-index: 1;
    position: absolute;
    width: 250px;
    top: @top-bar-height + @top-bar-boder-width;
    bottom: 0;
    overflow-y: auto;
  }

  .navbar-top-links .dropdown-messages,
  .navbar-top-links .dropdown-tasks,
  .navbar-top-links .dropdown-alerts {
    margin-left: auto;
  }
}"

".navbar {
  margin-bottom: 0;
}

.navbar-top-links {
  margin-right: 15px;

  li {
    display: inline-block;

    a {
      padding: 15px;
      // min-height: 50px;
    }
  }

  .dropdown-menu li {
    display: block;

    a {
      padding: 3px 20px;
      // min-height: 0;

      div {
        white-space: normal;
      }
    }
  }

  .dropdown-messages, .dropdown-tasks, .dropdown-alerts {
    width: 310px;
    min-width: 0;
  }

  .dropdown-messages {
    margin-left: 5px;
  }

  .dropdown-tasks {
    margin-left: -59px;
  }

  .dropdown-alerts {
    margin-left: -123px;
  }

  .dropdown-user {
    right: 0;
    left: auto;
  }
}
@media (min-width: 768px) {
  .navbar-right {
    margin-right: 15px;
  }    
}
"

"@media(min-width:768px) {   //PC端
  .table td .btn {
    margin-top: 2px;
    margin-bottom: 2px;
  }
}

.table td .btn {
  margin-left: 2px;
  margin-right: 2px;
}"

"@media(min-width:768px) {   //PC端
  .form-inline {
    .form-group {
      margin-top: 2px;
      margin-bottom: 2px;
      margin-right: 15px;
      white-space: nowrap;
    }
  }
}

.form-inline {
  & > .btn, & > label {
    margin-left: 10px;
    margin-right: 10px;
  }
}

.form-group .checkbox input[type="checkbox"] {
  margin-left: 0;
}

.form-required > label:after {
  content: " * ";
  color: red;
}"

".badge-important {
  background-color: @brand-danger;
}
.badge-info {
  background-color: @brand-primary;
}
.badge-success {
  background-color: @brand-success;
}
.badge-warning {
  background-color: @brand-warning;
}
.badge-inverse {
  background-color: #333;
}
"

"/* 彩色panel */
.panel-green {
  border-color: @brand-success;
  .panel-heading {
    border-color: @brand-success;
    color: white;
    background-color: @brand-success;
  }
  a {
    color: @brand-success;
    &:hover {
      color: darken(@brand-success, 15%);
    }
  }
}

.panel-red {
  border-color: @brand-danger;
  .panel-heading {
    border-color: @brand-danger;
    color: white;
    background-color: @brand-danger;
  }
  a {
    color: @brand-danger;
    &:hover {
      color: darken(@brand-danger, 15%);
    }
  }
}

.panel-yellow {
  border-color: @brand-warning;
  .panel-heading {
    border-color: @brand-warning;
    color: white;
    background-color: @brand-warning;
  }
  a {
    color: @brand-warning;
    &:hover {
      color: darken(@brand-warning, 15%);
    }
  }
}"

".btn-outline {
  color: inherit;
  background-color: transparent;
  transition: all .5s;
}

.btn-primary.btn-outline {
  color: @brand-primary;
}

.btn-success.btn-outline {
  color: @brand-success;
}

.btn-info.btn-outline {
  color: @brand-info;
}

.btn-warning.btn-outline {
  color: @brand-warning;
}

.btn-danger.btn-outline {
  color: @brand-danger;
}

.btn-primary.btn-outline:hover,
.btn-success.btn-outline:hover,
.btn-info.btn-outline:hover,
.btn-warning.btn-outline:hover,
.btn-danger.btn-outline:hover {
  color: #fff;
}

/* 圆形按钮 */
.btn-circle {
  width: 30px;
  height: 30px;
  padding: 6px 0;
  border-radius: 15px;
  text-align: center;
  font-size: 12px;
  line-height: 1.428571429;

  &.btn-lg {
    width: 50px;
    height: 50px;
    padding: 10px 16px;
    border-radius: 25px;
    font-size: 18px;
    line-height: 1.33;
  }

  &.btn-xl {
    width: 70px;
    height: 70px;
    padding: 10px 16px;
    border-radius: 35px;
    font-size: 24px;
    line-height: 1.33;
  }
}"

"/* 搬fontawesome的样式过来用 */
.iconfont {
  display: inline-block;
  width: 1.5em;
  text-align: center;
  font-size: inherit;
  text-rendering: auto;
}

/* 图标无限旋转 */
.iconfont--spin {
  -webkit-animation: iconfont--spin 2s infinite linear;
  animation: iconfont--spin 2s infinite linear;
}
@-webkit-keyframes iconfont--spin {
  0% {
    -webkit-transform: rotate(0deg);
    transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(359deg);
    transform: rotate(359deg);
  }
}
@keyframes iconfont--spin {
  0% {
    -webkit-transform: rotate(0deg);
    transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(359deg);
    transform: rotate(359deg);
  }
}"

"/* 全局通用style */
* {
  font-family: "Helvetica Neue",Helvetica,"PingFang SC","Hiragino Sans GB","Microsoft YaHei","微软雅黑",Arial,sans-serif;
}

html, body {
  .full-screen();
  background-color: @gray-lightest;
}

a {
  .cursorPointer();
}

/* 总容器 */
#wrapper {
  .full-screen();
}

#page-wrapper {
  padding: 5px 5px 5px 5px;
  background-color: white;

  .page-header {
    font-size: 20px;
  }
}
@media(min-width:768px) {   //PC端
  #page-wrapper {
    position: absolute;
    top: @top-bar-height + @top-bar-boder-width;
    bottom: 0;
    left: 250px;
    right: 0;
    padding: 10px 10px 10px 10px;
    overflow-y: auto;
    border-left: 1px solid darken(@gray-lightest, 6.5%);
  }
}

.picvcode {
  min-width: 80px;
}

/* 隐藏首屏加载页面时出现的花括号 */
.ms-controller{
   visibility: hidden
}"

"// Mixins
.full-screen() {
  width: 100%;
}

.size(@width, @height) {
  width: @width;
  height: @height;
}

.fl() {
  float: left;
}

.fr() {
  float: right;
}

.clearfix() {
  &:before,&:after{ 
    content:""; 
    display:table; 
  } 
  &:after{clear:both;} 
  &{ 
    *zoom:1;/*IE/7/6*/
  }
}

.noselect() {
  -moz-user-select:none;/*火狐*/
  -webkit-user-select:none;/*webkit浏览器*/
  -ms-user-select:none;/*IE10*/
  -khtml-user-select:none;/*早期浏览器*/
  user-select:none;
}

.block-center() {
  margin-right: auto;
  margin-left: auto;
  display: block;
}

.text-ellipsis() {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.cursorPointer() {
  cursor: pointer;
}
.cursorPointer {
  .cursorPointer();
}

.padding0() {
  padding: 0;
}
.padding0 {
  .padding0();
}"

"/* 颜色 */
@gray-darker: lighten(#000, 13.5%);
@gray-dark: lighten(#000, 20%);
@gray: lighten(#000, 33.5%);
@gray-light: lighten(#000, 60%);
@gray-lighter: lighten(#000, 93.5%);
@gray-lightest: lighten(#000, 97.25%);
@brand-primary: #428bca;
@brand-success: #5cb85c;
@brand-info: #5bc0de;
@brand-warning: #f0ad4e;
@brand-danger: #d9534f;

/* 各种尺寸 */
@top-bar-height: 51px;
@top-bar-boder-width: 1px;"

