"// Mixins
.full-screen() {
  width: 100%;
}

.size(@width, @height) {
  width: @width;
  height: @height;
}

.fl() {
  float: left;
}

.fr() {
  float: right;
}

.clearfix() {
  &:before,&:after{ 
    content:""; 
    display:table; 
  } 
  &:after{clear:both;} 
  &{ 
    *zoom:1;/*IE/7/6*/
  }
}

.noselect() {
  -moz-user-select:none;/*火狐*/
  -webkit-user-select:none;/*webkit浏览器*/
  -ms-user-select:none;/*IE10*/
  -khtml-user-select:none;/*早期浏览器*/
  user-select:none;
}

.block-center() {
  margin-right: auto;
  margin-left: auto;
  display: block;
}

.text-ellipsis() {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.cursorPointer() {
  cursor: pointer;
}
.cursorPointer {
  .cursorPointer();
}

.padding0() {
  padding: 0;
}
.padding0 {
  .padding0();
}"

"/* 全局通用style */
* {
  font-family: "Helvetica Neue",Helvetica,"PingFang SC","Hiragino Sans GB","Microsoft YaHei","微软雅黑",Arial,sans-serif;
}

html, body {
  .full-screen();
  background-color: @gray-lightest;
}

a {
  .cursorPointer();
}

/* 总容器 */
#wrapper {
  .full-screen();
}

#page-wrapper {
  padding: 5px 5px 5px 5px;
  background-color: white;

  .page-header {
    font-size: 20px;
  }
}
@media(min-width:768px) {   //PC端
  #page-wrapper {
    position: absolute;
    top: @top-bar-height + @top-bar-boder-width;
    bottom: 0;
    left: 250px;
    right: 0;
    padding: 10px 10px 10px 10px;
    overflow-y: auto;
    border-left: 1px solid darken(@gray-lightest, 6.5%);
  }
}

.picvcode {
  min-width: 80px;
}

/* 隐藏首屏加载页面时出现的花括号 */
.ms-controller{
   visibility: hidden
}"

"/* 搬fontawesome的样式过来用 */
.iconfont {
  display: inline-block;
  width: 1.5em;
  text-align: center;
  font-size: inherit;
  text-rendering: auto;
}

/* 图标无限旋转 */
.iconfont--spin {
  -webkit-animation: iconfont--spin 2s infinite linear;
  animation: iconfont--spin 2s infinite linear;
}
@-webkit-keyframes iconfont--spin {
  0% {
    -webkit-transform: rotate(0deg);
    transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(359deg);
    transform: rotate(359deg);
  }
}
@keyframes iconfont--spin {
  0% {
    -webkit-transform: rotate(0deg);
    transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(359deg);
    transform: rotate(359deg);
  }
}"

".btn-outline {
  color: inherit;
  background-color: transparent;
  transition: all .5s;
}

.btn-primary.btn-outline {
  color: @brand-primary;
}

.btn-success.btn-outline {
  color: @brand-success;
}

.btn-info.btn-outline {
  color: @brand-info;
}

.btn-warning.btn-outline {
  color: @brand-warning;
}

.btn-danger.btn-outline {
  color: @brand-danger;
}

.btn-primary.btn-outline:hover,
.btn-success.btn-outline:hover,
.btn-info.btn-outline:hover,
.btn-warning.btn-outline:hover,
.btn-danger.btn-outline:hover {
  color: #fff;
}

/* 圆形按钮 */
.btn-circle {
  width: 30px;
  height: 30px;
  padding: 6px 0;
  border-radius: 15px;
  text-align: center;
  font-size: 12px;
  line-height: 1.428571429;

  &.btn-lg {
    width: 50px;
    height: 50px;
    padding: 10px 16px;
    border-radius: 25px;
    font-size: 18px;
    line-height: 1.33;
  }

  &.btn-xl {
    width: 70px;
    height: 70px;
    padding: 10px 16px;
    border-radius: 35px;
    font-size: 24px;
    line-height: 1.33;
  }
}"

"/* 彩色panel */
.panel-green {
  border-color: @brand-success;
  .panel-heading {
    border-color: @brand-success;
    color: white;
    background-color: @brand-success;
  }
  a {
    color: @brand-success;
    &:hover {
      color: darken(@brand-success, 15%);
    }
  }
}

.panel-red {
  border-color: @brand-danger;
  .panel-heading {
    border-color: @brand-danger;
    color: white;
    background-color: @brand-danger;
  }
  a {
    color: @brand-danger;
    &:hover {
      color: darken(@brand-danger, 15%);
    }
  }
}

.panel-yellow {
  border-color: @brand-warning;
  .panel-heading {
    border-color: @brand-warning;
    color: white;
    background-color: @brand-warning;
  }
  a {
    color: @brand-warning;
    &:hover {
      color: darken(@brand-warning, 15%);
    }
  }
}"

